const Price = (props) => {

    //Destructuring
    const { price, percent_change_1h, percent_change_24h, percent_change_7d } = props.price;

    return (
        <div className="card text-white bg-success mb-3">
            <div className="card-header">Bitcoin price</div>

                <div className="card-body">
                    <h4 className="card-title">Actual price: ${price}</h4>
                    <div className="d-felx justify-content-between">
                        <p className="card-text">
                            <span className="font-weight-bold">Last hour:  {percent_change_1h}%</span>
                        </p>
                        <p className="card-text">
                            <span className="font-weight-bold">Last day:  {percent_change_24h}%</span>
                        </p>
                        <p className="card-text">
                            <span className="font-weight-bold">Last week:  {percent_change_7d}%</span>
                        </p>
                    </div>
                </div>

        </div>
    );
};

export default Price;
